export default class LocalJson extends Component {
	render() {
		return (
			<div>
				<Container fluid={true}>
					<Row>
						<CardDeck className=" no-gutters ">
							{data.map((postData) => {
                                console.log(postData);
                                {postData.map((hits) => {
								return (

									<Card key={hits.id}>
										<Card.Img variant="top" src={hits.previewURL} />
										<Card.Body>
											<Card.Title className="tile">
												{hits.pageURL}
											</Card.Title>
											<Card.Subtitle className="tag">
												{hits.id + " "}
											</Card.Subtitle>

											<Card.Text className="para">
												{hits.user}
											</Card.Text>
										</Card.Body>
                                    </Card>

                                );
                            })}
							})}
						</CardDeck>
					</Row>
				</Container>
			</div>
		);
	}
}
